import React from 'react';
import Nav from 'react-bootstrap/Nav'


function Classes() {
  return (
    <div className="Classes">
      <Nav justify variant="tabs" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link href=" ">Degree Plan</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="">Class Taken</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="">Class Not Taken</Nav.Link>
        </Nav.Item>
    </Nav>
    </div>
  );
}

export default Classes;
